import React from "react";

function Login() {
  return (
    <div>

    <form action="/login">
        <div><img class="img_job" src="https://th.bing.com/th/id/OIP.fC1wJpC_gAgf8djU_I07OgHaFj?w=256&h=192&c=7&r=0&o=5&pid=1.7" /></div>
        <div><input placeholder="USERNAME" name="username" type="text" /></div>
        <div><input placeholder="PASSWORD" name="password" type="password" /></div>
        <button type="button" class="btn btn-outline-success">
          Login
        </button>
      </form>
    </div>
  );
}
export default Login;
